import React from "react";
import TableRow from "./table-row";

const Table = (props) => {
    return (
        <div>
            <ul className="list-group">
                <TableRow />
                <TableRow />
                <TableRow />
                <TableRow />
            </ul>
        </div>
    );
};

export default Table;
